gerschgorinDisks[A_] := Module[{p, di},
  di = Table[
    Circle[{A[[i, i]], 0}, Abs[gerschgorinSum[A][i]]], {i,
     Length@A}];
  p = ListPlot[(Tooltip[{Re[#1], Im[#1]}] &) /@ N[Eigenvalues[A]],
    AspectRatio -> 1, PlotStyle -> Red];
  Show[Graphics[di], p, Axes -> True]
  ];
gerschgorinIntervals[A_] := Module[{tt},
  tt = Table[
    Interval[{A[[i, i]] - gerschgorinSum[A][i],
      A[[i, i]] + gerschgorinSum[A][i]}], {i, Length@A}];
  nnn = NumberLinePlot[Eigenvalues[A], PlotStyle -> Red];
  Show[NumberLinePlot[tt~Join~{Union @@ tt}, PlotTheme -> "Detailed"],
    nnn]
  ];
gerschgorinSum[A_][i_] := Table[If[j != i, A[[i, j]], Nothing], {j, 1, Length[A]}] // Total;
mform:= $PrePrint=MatrixForm@#&;
mform2:= $PrePrint=MatrixForm/@#&@#&;
mform0:= $PrePrint=#&;
LUMatrices[mm_?MatrixQ] := Module[{m},
  m=First@LUDecomposition[mm];
  {m - # + IdentityMatrix[Length@m], #} &[m*Array[Boole[# <= #2] &, Dimensions@m]]
];


